import React from 'react'
import styles from './Header.css'

const Header = () => {
    return(
        <header>
        <div className={styles["header"]}>
          <h1 id={styles["header-title"]}>THE FALSE 9</h1>
        </div>
      </header>
    )
}

export default Header;
